import { Grid } from "@mui/material";
import React from "react";

const Dashboard = () => {
    return (
        <Grid container gap={1} margin={'1em'}>
            <Grid item border={1} xs={2} height={'10em'}>
                Hello
            </Grid>
            <Grid item border={1} xs={2} height={'10em'}>
                Hello
            </Grid>
            <Grid item border={1} xs={2} height={'10em'}>
                Hello
            </Grid>
        </Grid>
    )
}

export default Dashboard;
